/* This file will support a page that lists and describes the skills that I have */

import { View, StyleSheet, Text, FlatList } from "react-native";
import React from "react";

import { motion } from "framer-motion";

import TopBar from "./TopBar";

const styles = StyleSheet.create({
    column1: {
        flexDirection: "column"
    },
    column2: {

    },
    column2: {

    },
    skillName: {
        fontFamily: "Iceland",
        fontSize: 40,
        paddingLeft: 20
    }
    
})

const skills = ["Python", "JavaScript", "C (language)", "Scala", "Java", "React-Native", "MySQL", "Docker", "MongoDB", "Linux", "Git"]

function Skills() {
    return(
        <View>
            <TopBar></TopBar>
            <FlatList horizontal={true} data={skills} renderItem={({item}) =>
                <motion.div initial={{y: '25vw'}} animate={{y: 0}} transition={{ type: "spring", bounce: 0.5}}>
                    <Text style={styles.skillName}>{item}</Text>
                </motion.div>}>     
            </FlatList>
        </View>
    )
}

export default Skills;
